    const [card, setCard] = useState({});
    const data = fakeData;
    console.log(card.length)

    useEffect(() => {
        setCard(data)
    }, [])
    return (
        <div className='container'>
            {
                card.map(item => <AllCart item={item}></AllCart>)
            }
        </div>
    );
};

export default Home;
